import React from "react";
import "./style.css";

function Jumbotron() {
  return (
    <div className="jumbotron text-center">
      <h1>Equestrian Competition App</h1>
      <a target="_blank" rel="noopener noreferrer" href="http://www.Competitionpuppy.com/about/api/">
        Powered by Amthlete
      </a>
    </div>
  );
}

export default Jumbotron;
